43X)"]},{"cell_type":"markdown","id":"9d4019c7","metadata":{"papermill":{"duration":0.008517,"end_time":"2023-08-13T10:52:51.349097","exception":false,"start_time":"2023-08-13T10:52:51.34058","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"324ec69a","metadata":{"papermill":{"duration":0.00822,"end_time":"2023-08-13T10:52:51.366117","exception":false,"start_time":"2023-08-13T10:52:51.357897","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"9a046e8d","metadata":{"execution":{"iopub.execute_input":"2023-08-13T10:52:51.386552Z","iopub.status.busy":"2023-08-13T10:52:51.385081Z","iopub.status.idle":"2023-08-13T10:52:51.43513Z","shell.execute_reply":"2023-08-13T10:52:51.433385Z"},"papermill":{"duration":0.063291,"end_time":"2023-08-13T10:52:51.437709","exception":false,"start_time":"2023-08-13T10:52:51.374418","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>abr